import React from 'react';
import data from './data.json'
import styles from './App.module.css';
import Header from './components/HistoriaHeader';
import Category from './components/Historia.js';




const mainfiles=[
  {
    Topic:'Ostoshistoria',
    
  },

]



function App() {

  return (

  <div>
    <Header />
    
    <div className={styles.paasivubar}>
      <div className={styles.maincontainer}>
         {
           mainfiles.map(element => <Historia Topic ={element.Topic} />)  
         }
         </div>
         </div>
         </div>
         

         
         
         
         
    
  )
}

export default App;
